def count_bits(a):
    return bin(a).count('1')


def board_to_bbs(board, col):
    m_bb = 0x0000000000000000
    o_bb = 0x0000000000000000

    for y in range(len(board)):
        for x in range(len(board[y])):
            if board[y][x] == col:
                m_bb |= 0x01 << x + y * 8
            elif board[y][x] != " ":
                o_bb |= 0x01 << x + y * 8
    return m_bb, o_bb


def board_to_pos(board, col):
    pos = 0x00000000000000000000000000000000

    for y in range(len(board)):
        for x in range(len(board[y])):
            if board[y][x] == col:
                pos |= 0x01 << (x + y * 8) + 64
            elif board[y][x] != " ":
                pos |= 0x01 << (x + y * 8)
    return pos


def bb_to_pos(m_bb, o_bb):
    return (m_bb << 64) | o_bb


def pos_to_m_bb(pos):
    return pos >> 64


def pos_to_o_bb(pos):
    return pos & 0xFFFFFFFFFFFFFFFF


def pos_to_bb(pos):
    return pos_to_m_bb(pos), pos & pos_to_o_bb(pos)


def pos_to_c_bb(pos):
    return pos_to_m_bb(pos) | pos_to_o_bb(pos)


def is_tie(pos):
    return pos_to_c_bb(pos) == 0xffffffffffffffff


def move_to_yx(move):
    i = 0
    while not move & 0x1 and i < 64:
        i += 1
        move = move >> 1
    if i >= 64:
        return 0, 0
    return i_to_yx(i)


def find_move(pos, n_pos):
    return pos_to_c_bb(pos ^ n_pos)


def i_to_yx(i):
    return i // 8, i % 8


def print_bb(bb):
    s = "*"
    for i in range(7):
        s += str(i%10) + "|"
    s += str((7)%10)
    s += "*\n"

    for i in range(8):
        s += str(i%10)
        for j in range(8-1):
            s += ('X' if (1 & bb >> (i*8 + j)) else ' ') + "|"
        s += 'X' if (1 & bb >> (i*8 + 7)) else ' '

        s += "*\n"
    s += (8*2 + 1)*"*"

    print(s)


def yx_to_i(y, x):
    return (y*8 + x)


def yx_to_move(y, x):
    return 1 << yx_to_i(y, x)


def get_i(bb, i):
    return 1 & (bb >> i)


def place_i(bb, i):
    return bb | 1 << i


def pos_place_i(pos, i, mtm):
    m_bb = pos_to_m_bb(pos)
    o_bb = pos_to_o_bb(pos)
    if mtm:
        m_bb = place_i(m_bb, i)
    else:
        o_bb = place_i(o_bb, i)
    return bb_to_pos(m_bb, o_bb)


